import { motion } from "framer-motion"
import estyle from "./RectangleFill.module.scss"

function RectangleFill({props}) {

    const svgVariants = {
        hidden: { opacity: 0 },
        visible: { opacity: 1, transition: { delay: props.delay, duration : 1 }}
    }

    return (
        <div>
            <motion.svg width="101" height="6" viewBox="0 0 101 6" fill="none" xmlns="http://www.w3.org/2000/svg"
                variants={svgVariants}
                initial="hidden"
                animate="visible"
            >
                <path d="M80.559 0.722412H0.560425V5.72232H80.559V0.722412Z" fill={props.color}/>
                <path d="M100.562 0.722412H0.563477V5.72232H100.562V0.722412Z" stroke={props.color} stroke-width="0.32024" stroke-miterlimit="1.5" stroke-linecap="round" stroke-linejoin="round"/>
            </motion.svg>
        </div>
    )
}
export default RectangleFill;
